local idDialogo = 1000
function main()
    while not isSampAvailable() do wait(100) end

    
    while true do
        if isWidgetSwipedRight(WIDGET_RADAR) then
            settings[0] = not settings[0]
        end
        wait(0)
    end

    sampRegisterChatCommand('xd', function()
        settings[0] = not settings[0]
    end)



    sampRegisterChatCommand('anim', function(param)
        if param == "" then
            sampAddChatMessage('{FFA500}Lista de anims disponibles:', 0xFFFFFF)
            for i, animacion in ipairs(anims) do
                sampAddChatMessage(string.format('{00FF00}/anim %d {FFFFFF}- %s', i, animacion.name), 0xFFFFFF)
            end
        else
            local indice = tonumber(param)
            if indice and anims[indice] then
                playAnim(anims[indice].lib, anims[indice].anim, 4.1, true, false, false, false, 0)
                sampAddChatMessage(string.format('{00FF00}Animacion activada: {FFFFFF}%s', anims[indice].name), 0xFFFFFF)
            else
                sampAddChatMessage('{FF0000}Anim no valida. Usa /anims para ver la lista.', 0xFFFFFF)
            end
        end
    end)

    sampRegisterChatCommand('anims', function()
        local lista = ""
        for i, animacion in ipairs(anims) do
            lista = lista .. string.format("%d. %s\n", i, animacion.name)
        end
        sampShowDialog(idDialogo, "Lista de Animaciones", lista, "Seleccionar", "Cerrar", 2)
    end)

    sampRegisterChatCommand("noanim", function()
        StopAnim()
        sampAddChatMessage("[Animaciones] Animaciones detenidas.", 0xFFFFFF)
    end)

    wait(-1)

end

local function drawAnimButton(idx, icon)
    local size = imgui.ImVec2(60, 60)
    local animData = anims[idx]

    local isPlaying = false
    if animData.name == "Mear" then
        isPlaying = animData.active
    else
        isPlaying = isCharPlayingAnim(PLAYER_PED, animData.anim)
    end

    if imgui.InvisibleButton("##btn_anim" .. idx, size) then
        if animData.name == "Mear" then
            if animData.active then
                sampSetSpecialAction(0)
                animData.active = false
            else
                sampSetSpecialAction(68)
                animData.active = true
            end
        else
            if anims[6].active then
                sampSetSpecialAction(0)
                anims[6].active = false
            end

            if isPlaying then
                StopAnim()
            else
                playAnim(animData.lib, animData.anim, 4.1, true, false, false, false, 0)
            end
        end
    end

    if isPlaying then
        imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0.0, 1.0, 0.0, 1.0))
    else
        imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1.0, 1.0, 1.0, 1.0))
    end

    local pos = imgui.GetItemRectMin()
    local textSize = imgui.CalcTextSize(icon)
    local centerX = pos.x + (size.x - textSize.x) / 2 - 8
    local centerY = pos.y + (size.y - textSize.y) / 2 + 2

    imgui.SetCursorScreenPos(imgui.ImVec2(centerX, centerY))
    imgui.PushFont(iconFont)
    imgui.Text(icon)
    imgui.PopFont()

    imgui.PopStyleColor()
end


