local function loadFAFont(style, size, merge)
    local cfg = imgui.ImFontConfig()
    cfg.MergeMode = merge or false
    cfg.PixelSnapH = true
    iconRanges = new.ImWchar[3](fa.min_range, fa.max_range, 0)

	return imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(fa.get_font_data_base85(style), size, cfg, iconRanges)
end

imgui.OnInitialize(function()
    SwitchTheStyle()

    local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesDefault()
    local fontPath = getWorkingDirectory()  .. "/resource/fonts/"

	font1 = imgui.GetIO().Fonts:AddFontFromFileTTF(fontPath .. "Verdana.ttf", 25, nil, glyph_ranges)
	loadFAFont("solid", 20, true)
	iconFont = loadFAFont("solid", 30)
	logofont = imgui.GetIO().Fonts:AddFontFromFileTTF(fontPath .. "font1.otf", 45, nil, glyph_ranges)
	loadFAFont("solid", 30, true)

end)


function playAnim(lib, anim, speed, loop, lockX, lockY, freeze, time)
    local bs = raknetNewBitStream()
    raknetBitStreamWriteInt16(bs, select(2, sampGetPlayerIdByCharHandle(PLAYER_PED)))
    raknetBitStreamWriteInt8(bs, #lib)
    raknetBitStreamWriteString(bs, lib)
    raknetBitStreamWriteInt8(bs, #anim)
    raknetBitStreamWriteString(bs, anim)
    raknetBitStreamWriteFloat(bs, speed)
    raknetBitStreamWriteBool(bs, loop)
    raknetBitStreamWriteBool(bs, lockX)
    raknetBitStreamWriteBool(bs, lockY)
    raknetBitStreamWriteBool(bs, freeze)
    raknetBitStreamWriteInt32(bs, time)
    raknetEmulRpcReceiveBitStream(86, bs)
    raknetDeleteBitStream(bs)
end

function StopAnim()
    local bs = raknetNewBitStream()
    raknetBitStreamWriteInt16(bs, select(2, sampGetPlayerIdByCharHandle(PLAYER_PED)))
    raknetEmulRpcReceiveBitStream(87, bs)
    raknetDeleteBitStream(bs)
end

